import React, { Component } from "react";

export default class Productitem extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    const { productName, unitPrice, productImg } = this.props;
    return (
      <div>
        <img src={process.env.PUBLIC_URL + productImg}></img>
        <p>{productName}</p>
        <p>{unitPrice}</p>
      </div>
    );
  }
}
